import React, { Suspense } from "react";
import ReactDOM from "react-dom";
import App from "./App";
import SimpleReactLightbox from "simple-react-lightbox";
import "./i18n";
import Loader from "./Loader";

ReactDOM.render(
  <SimpleReactLightbox>
    <Suspense fallback={<Loader/>}>
      <App />
    </Suspense>
  </SimpleReactLightbox>,
  document.getElementById("root")
);
